import React from 'react';
import ServiceItem from './ServiceItem';

function HomePage() {
    return (
        <div className="homePage">
            <div className="servicesZone">
                <div className="title">
                    <h2>
                        Сервіси
                    </h2>
                </div>
                <div className="items">
                    <ServiceItem />
                </div>
            </div>
        </div>
    );
}

export default HomePage;
